import React, {Component} from 'react';
import { Redirect } from 'react-router-dom';

export default class Logout extends Component {
  	constructor(props) {
	    super(props);
	    this.state = {
	    	redirect:true,
	    	hasSession:false,
	    	notif_msg:''
		}
		this.renderRedirect = this.renderRedirect.bind(this);
	};
	componentDidMount(){
		const SERVER_ERR_MSG = "Oops, it seems that we have some troubles for our server";
		fetch('/user/logout').then((res) => {
	      return res.json();
	    }).then((res) => {
	      // console.log(res);
	    	if(res.state)
		      	this.setState({hasSession: true, notif_msg:"Successfully logout"});
		  	else
				this.setState({hasSession: false});
	    })
	    .catch((err) => {
	    	//
	    	console.log("went wrong");
			this.setState({hasSession: true, notif_msg: SERVER_ERR_MSG});
	    });
	}
	componentWillMount(){
		this.isCancelled = true;
	}

	renderRedirect = () => {
		console.log(hasSession);
		if(this.state.hasSession)
			return <Redirect to={{pathname:'/notification', msg: this.state.notif_msg, state: 0}} />
		else
			return <Redirect to={{pathname:'/'}} />
	}

	render(){
		return(
			<div>
				{this.renderRedirect()}
			</div>
		)
	}
}
